!function(){$(document).ready(function(){for(var t=JSON.parse($("#cloud").attr("data")),n=-1,o=9999999,a=0;a<t.length;a++)n=Math.max(t[a][1],n),o=Math.min(t[a][1],o);for(a=0;a<t.length;a++)t[a][1]=n==o?Math.round(40):Math.round(20+40*(t[a][1]-o)/(n-o));var e=$("#cloud").parent()[0].clientWidth,r=Math.min(9*e/16,400);$("#cloud").attr("width",e),$("#cloud").attr("height",r),WordCloud(document.getElementById("cloud"),{gridSize:18,fontFamily:"Finger Paint, cursive, sans-serif",list:t,click:function(t){window.location.href="/ranking?type=Overall&language="+encodeURIComponent(t[0])},backgroundColor:"#FFFFFF"})})}();